import Icon from '../../assets/Icon.svg';
import React from 'react';
import './Footer.css';

function Header() {
    return (
        <footer>
            <div className={'box-footer'}>
                <div className={'box-footer-tos'}>
                    <p> Terms of Service</p>
                </div>
                <div className={'box-footer-pp'}>
                    <h1>Privacy Policy</h1>
                </div>
            </div>
        </footer>
    );
}

export default Header;
